import React, { useState } from 'react';
import './css/FramePage.css';
// import { CalculationDto, OpeningsStructuralElementFrameDto, ElementFrameDto, OpeningsDto } from './path/to/your/dto';


function FramePage() {
  const [address, setAddress] = useState('');
  const [inputValues, setInputValues] = useState({
    initialData: '',
    floorCount: '',
    firstFloor: '',
    floorHeight: '',
    outerWallPerimeter: '',
    baseArea: '',
    outerWallThickness: '',
    outerWallCladding: '',
    paroHydroInsulation: '',
    windProtection: '',
    insulation: '',
    innerWallLength: '',
    interiorWallThickness: '', // Исправлено
    osb: '', // Добавлено
    heightWindow: '', // Добавлено
    widthWindow: '', // Добавлено
    sumWindow: '', // Добавлено
    heightDoorOuter: '', // Добавлено
    widthDoorOuter: '', // Добавлено
    sumDoorOuter: '', // Добавлено
    heightDoorInner: '', // Добавлено
    widthDoorInner: '', // Добавлено
    sumDoorInner: '', // Добавлено
    floorthickness: '', // Добавлено
  });
  const [doorWindows, setDoorWindows] = useState([{ height: '', width: '', count: '' }]);
  const [outerDoors, setOuterDoors] = useState([{ height: '', width: '', count: '' }]);
  const [innerDoors, setInnerDoors] = useState([{ height: '', width: '', count: '' }]);

  const handleAddFloors = () => {
    // Дублируем поля для всех остальных этажей
    const duplicatedDoorWindows = Array.from({ length: floorCount - 1 }, () => ({ height: '', width: '', count: '' }));
    const duplicatedOuterDoors = Array.from({ length: floorCount - 1 }, () => ({ height: '', width: '', count: '' }));
    const duplicatedInnerDoors = Array.from({ length: floorCount - 1 }, () => ({ height: '', width: '', count: '' }));

    setDoorWindows(prevState => [...prevState, ...duplicatedDoorWindows]);
    setOuterDoors(prevState => [...prevState, ...duplicatedOuterDoors]);
    setInnerDoors(prevState => [...prevState, ...duplicatedInnerDoors]);
  };

  const handleDoorWindowChange = (index, name, value) => {
    const updatedDoorWindows = [...doorWindows];
    updatedDoorWindows[index][name] = value;
    setDoorWindows(updatedDoorWindows);
  };

  const handleOuterDoorChange = (index, name, value) => {
    const updatedOuterDoors = [...outerDoors];
    updatedOuterDoors[index][name] = value;
    setOuterDoors(updatedOuterDoors);
  };

  const handleInnerDoorChange = (index, name, value) => {
    const updatedInnerDoors = [...innerDoors];
    updatedInnerDoors[index][name] = value;
    setInnerDoors(updatedInnerDoors);
  };

  // Добавление нового поля для дверных проемов
  const handleAddDoorWindow = () => {
    setDoorWindows([...doorWindows, { height: '', width: '', count: '' }]);
  };

  const handleAddOuterDoor = () => {
    setOuterDoors([...outerDoors, { height: '', width: '', count: '' }]);
  };

  const handleAddInnerDoor = () => {
    setInnerDoors([...innerDoors, { height: '', width: '', count: '' }]);
  };

  const [calculations, setCalculations] = useState([]);
  const client = {
    name: 'Тестовый Тест Тестов',
    address: 'ул.Тестовая ул., дом 43-45',
    phone: 'тел. 8-900-000-00-00',
  };

  const handleSave = () => {
    if (address.trim() !== '') {
      const newElementFrameDto = {
        amountFloor: parseInt(inputValues.floorCount),
        floorNumber: parseInt(inputValues.firstFloor),
        floor_height: parseFloat(inputValues.floorHeight),
        perimeterOfExternalWalls: parseFloat(inputValues.outerWallPerimeter),
        baseArea: parseFloat(inputValues.baseArea),
        externalWallThickness: parseFloat(inputValues.outerWallThickness),
        internalWallLength: parseFloat(inputValues.innerWallLength),
        internalWallThickness: parseFloat(inputValues.interiorWallThickness),
        osbExternalWall: inputValues.osb,
        steamWaterproofingExternalWall: inputValues.paroHydroInsulation,
        windscreenExternalWall: inputValues.windProtection,
        overlapThickness: inputValues.floorthickness,
        insulationExternalWall: inputValues.insulation,
        osbThickness: inputValues.osb,
        steamWaterproofingThickness: inputValues.paroHydroInsulation,
        windscreenThickness: inputValues.windProtection,
        insulationThickness: inputValues.insulation,
        osbInternalWall: inputValues.osb,
        openingsAmount: doorWindows.length + outerDoors.length + innerDoors.length,
      };
  
      const newOpeningsDtoArray = [
        ...doorWindows.map(doorWindow => ({
          type: 'window',
          width: parseFloat(doorWindow.width),
          height: parseFloat(doorWindow.height),
        })),
        ...outerDoors.map(outerDoor => ({
          type: 'outerDoor',
          width: parseFloat(outerDoor.width),
          height: parseFloat(outerDoor.height),
        })),
        ...innerDoors.map(innerDoor => ({
          type: 'innerDoor',
          width: parseFloat(innerDoor.width),
          height: parseFloat(innerDoor.height),
        })),
      ];
  
      const newOpeningsStructuralElementFrameDto = {
        elementFrame: newElementFrameDto,
        openingsDtos: newOpeningsDtoArray,
        amount: [newOpeningsDtoArray.length], // Пример значения amount, массив с одним элементом, равным длине openingsDtos
      };
  
      const newCalculation = {
        address_object_constractions: address,
        openingsStructuralElementFrameDtos: newOpeningsStructuralElementFrameDto,
      };
  
      setCalculations([...calculations, newCalculation]);
      setAddress('');
      setInputValues({
        initialData: '',
        floorCount: '',
        firstFloor: '',
        floorHeight: '',
        outerWallPerimeter: '',
        baseArea: '',
        outerWallThickness: '',
        outerWallCladding: '',
        paroHydroInsulation: '',
        windProtection: '',
        insulation: '',
        innerWallLength: '',
        interiorWallThickness: '',
        osb: '',
        heightWindow: '',
        widthWindow: '',
        sumWindow: '',
        heightDoorOuter: '',
        widthDoorOuter: '',
        sumDoorOuter: '',
        heightDoorInner: '',
        widthDoorInner: '',
        sumDoorInner: '',
        floorthickness: '',
      });
      setDoorWindows([{ height: '', width: '', count: '' }]);
      setOuterDoors([{ height: '', width: '', count: '' }]);
      setInnerDoors([{ height: '', width: '', count: '' }]);
    }
  };
  

  const handleClear = () => {
    setAddress('');
    setInputValues({
      initialData: '',
      floorCount: '',
      firstFloor: '',
      floorHeight: '',
      outerWallPerimeter: '',
      baseArea: '',
      outerWallThickness: '',
      outerWallCladding: '',
      paroHydroInsulation: '',
      windProtection: '',
      insulation: '',
      innerWallLength: '',
      interiorWallThickness: '',
      osb: '',
      heightWindow: '',
      widthWindow: '',
      sumWindow: '',
      heightDoorOuter: '',
      widthDoorOuter: '',
      sumDoorOuter: '',
      heightDoorInner: '',
      widthDoorInner: '',
      sumDoorInner: '',
      floorthickness: '',
    });
  };

  const handleClose = () => {
    window.location.href = '/';
  };

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setInputValues({
      ...inputValues,
      [name]: value,
    });
  };

  return (
    <body>
      <header>
        <div className="name">
          <h1>{client.name}</h1>
          <p>{client.address}</p>
          <p>{client.phone}</p>
        </div>
        <button className="close-button" onClick={handleClose}>X</button>
      </header>
      <div className="container">
        <form className="form1">
          <h2 className="title">Каркас</h2>
          <div style={{ display: 'flex', marginBottom: '10px' }}>
            <input
              type="text"
              className="address-input"
              placeholder="Добавить адрес объекта строительства"
              value={address}
              onChange={(e) => setAddress(e.target.value)}
            />
            <button className="button" onClick={handleSave}>Сохранить</button>
            <button className="button" onClick={handleClear}>Очистить</button>
          </div>
          <div className="input-row">
        <label className="label1">Исходные данные:</label>
        
            </div>
            <div className="input-row">
        <label className="label">Количество этажей:</label>
        <input
          type="number"
          name="floorCount"
          value={floorCount}
          onChange={(e) => setFloorCount(parseInt(e.target.value))}
        />
        <button className="button" onClick={handleAddFloors}>Подтвердить</button>
      </div>
            <div className="input-row">
            <label className="label">Первый этаж:</label>
            
            </div>
            <div className="input-row">
            <label className="label">Высота этажа:</label>
            <input
                type="number"
                name="floorHeight"
                value={inputValues.floorHeight}
                onChange={handleInputChange}
            />
            </div>
            <div className="input-row">
            <label className="label">Периметр наружных стен:</label>
            <input
                type="number"
                name="outerWallPerimeter"
                value={inputValues.outerWallPerimeter}
                onChange={handleInputChange}
            />
            </div>
            
        <div className="input-row">
        <label className="label">Площадь основания:</label>
        <input
            type="number"
            name="baseArea"
            value={inputValues.baseArea}
            onChange={handleInputChange}
        />
        </div>
        <div className="input-row">
        <label className="label">Толщина внешних стен:</label>
        <select
            name="outerWallThickness"
            value={inputValues.outerWallThickness}
            onChange={handleInputChange}
        >
            <option value="Выбор большой">большая</option>
            <option value="Выбор средней">средняя</option>
            <option value="Выбор маленькой">маленькая</option>
        </select>
        </div>
        <div className="input-row">
        <label className="label">Длина внутренних стен:</label>
        <input
            type="number"
            name="baseArea"
            value={inputValues.baseArea1}
            onChange={handleInputChange}
        />
        </div>
        <div className="input-row">
        <label className="label">Толщина внутренних стен:</label>
        <select
            name="interiorWallThickness"
            value={inputValues.interiorWallThickness}
            onChange={handleInputChange}
        >
            <option value="Выбор большой">большая</option>
            <option value="Выбор средней">средняя</option>
            <option value="Выбор маленькой">маленькая</option>
        </select>
        </div>
        <div className="input-row">
        <label className="label1">Обшивка внешних стен:</label>
        </div>
        <div className="input-row">
        <label className="label">ОСБ:</label>
        <select
            name="osb"
            value={inputValues.osb}
            onChange={handleInputChange}
        >
            <option value="Выбор 1">1</option>
            <option value="Выбор 2">2</option>
            <option value="Выбор 3">3</option>
        </select>
        </div>
        <div className="input-row">
        <label className="label">Парогидроизоляция:</label>
        <select
            name="paroHydroInsulation"
            value={inputValues.paroHydroInsulation}
            onChange={handleInputChange}
        >
            <option value="Выбор 1">1</option>
            <option value="Выбор 2">2</option>
            <option value="Выбор 3">3</option>
        </select>
        </div>
        <div className="input-row">
        <label className="label">Ветрозащита:</label>
        <select
            name="windProtection"
            value={inputValues.windProtection}
            onChange={handleInputChange}
        >
            <option value="Выбор 1">1</option>
            <option value="Выбор 2">2</option>
            <option value="Выбор 3">3</option>
        </select>
        </div>
        <div className="input-row">
        <label className="label">Утеплитель:</label>
        <select
            name="insulation"
            value={inputValues.insulation}
            onChange={handleInputChange}
        >
            <option value="Выбор 1">1</option>
            <option value="Выбор 2">2</option>
            <option value="Выбор 3">3</option>
        </select>
        </div>
        <div className="input-row">
        <label className="label">ОСБ:</label>
        <select
            name="osb"
            value={inputValues.osb}
            onChange={handleInputChange}
        >
            <option value="Выбор 1">1</option>
            <option value="Выбор 2">2</option>
            <option value="Выбор 3">3</option>
        </select>
        </div>
        {/* Оконные проемы */}
        <div className="input-row">
            <label className="label1">Оконные проёмы:</label>
          </div>
          <div className="input-row">
            <label className="label2">Высота</label>
            <label className="label2">Ширина</label>
            <label className="label2">Количество</label>
          </div>
          {doorWindows.map((doorWindow, index) => (
            <div className="input-row" key={`doorWindow_${index}`}>
              <input
                type="number"
                value={doorWindow.height}
                onChange={(e) => handleDoorWindowChange(index, 'height', e.target.value)}
              />
              <input
                type="number"
                value={doorWindow.width}
                onChange={(e) => handleDoorWindowChange(index, 'width', e.target.value)}
              />
              <input
                type="number"
                value={doorWindow.count}
                onChange={(e) => handleDoorWindowChange(index, 'count', e.target.value)}
              />
            </div>
          ))}
          <button className="button" type="button" onClick={handleAddDoorWindow}>+</button>
          {/* Внешние дверные проемы */}
          <div className="input-row">
            <label className="label1">Дверные проёмы внешние:</label>
          </div>
          <div className="input-row">
            <label className="label2">Высота</label>
            <label className="label2">Ширина</label>
            <label className="label2">Количество</label>
          </div>
          {outerDoors.map((outerDoor, index) => (
            <div className="input-row" key={`outerDoor_${index}`}>
              <input
                type="number"
                value={outerDoor.height}
                onChange={(e) => handleOuterDoorChange(index, 'height', e.target.value)}
              />
              <input
                type="number"
                value={outerDoor.width}
                onChange={(e) => handleOuterDoorChange(index, 'width', e.target.value)}
              />
              <input
                type="number"
                value={outerDoor.count}
                onChange={(e) => handleOuterDoorChange(index, 'count', e.target.value)}
              />
            </div>
          ))}
          <button className="button" type="button" onClick={handleAddOuterDoor}>+</button>
          {/* Внутренние дверные проемы */}
          <div className="input-row">
            <label className="label1">Дверные проёмы внутренние:</label>
          </div>
          <div className="input-row">
            <label className="label2">Высота</label>
            <label className="label2">Ширина</label>
            <label className="label2">Количество</label>
          </div>
          {innerDoors.map((innerDoor, index) => (
            <div className="input-row" key={`innerDoor_${index}`}>
              <input
                type="number"
                value={innerDoor.height}
                onChange={(e) => handleInnerDoorChange(index, 'height', e.target.value)}
              />
              <input
                type="number"
                value={innerDoor.width}
                onChange={(e) => handleInnerDoorChange(index, 'width', e.target.value)}
              />
              <input
                type="number"
                value={innerDoor.count}
                onChange={(e) => handleInnerDoorChange(index, 'count', e.target.value)}
              />
            </div>
          ))}
          <button className="button" type="button" onClick={handleAddInnerDoor}>+</button>
          
        <div className="input-row">
        <label className="label">Толщина перекрытия:</label>
        <input
            type="number"
            name="floorthickness"
            value={inputValues.floorthickness}
            onChange={handleInputChange}
        />
        </div>
        <div className="input-row">
        <label className="label">ОСБ</label>
        <select
            name="osb"
            value={inputValues.osb}
            onChange={handleInputChange}
        >
            <option value="Выбор большая">большая</option>
            <option value="Выбор средняя">средняя</option>
            <option value="Выбор маленькая">маленькая</option>
        </select>
        </div>
        <div className="input-row">
        <label className="label">Парогидроизоляция:</label>
        <select
            name="paroHydroInsulation"
            value={inputValues.paroHydroInsulation}
            onChange={handleInputChange}
        >
            <option value="Выбор большая">большая</option>
            <option value="Выбор средняя">средняя</option>
            <option value="Выбор маленькая">маленькая</option>
        </select>
        </div>
        <div className="input-row">
        <label className="label">Ветрозащита:</label>
        <select
            name="windProtection"
            value={inputValues.windProtection}
            onChange={handleInputChange}
        >
            <option value="Выбор большая">большая</option>
            <option value="Выбор средняя">средняя</option>
            <option value="Выбор маленькая">маленькая</option>
        </select>
        </div>
        <div className="input-row">
        <label className="label">Утеплитель:</label>
        <select
            name="insulation"
            value={inputValues.insulation}
            onChange={handleInputChange}
        >
            <option value="Выбор большая">большая</option>
            <option value="Выбор средняя">средняя</option>
            <option value="Выбор маленькая">маленькая</option>
        </select>
        </div>
        <button className='btn_save' onClick={handleSave}>Сохранить расчет</button>



    {/* Другие поля ввода */}

    </form>
      </div>
    </body>
  );
}

export default FramePage;
